import Wellspring from './Wellspring';
// import StrikeModifiers from './StrikeModifiers';

const Daily: FC = () => {
    return (
        <div className='info'>
            <div className='display-in-row'>
                <h2>Daily Rotations</h2>
                <Countdown type="daily"/>
            </div>

            <h4>Lost Sector</h4>
            <LostSectorRotation />
            
            {/* <div className='display-in-row rowSpacing'>
