                </div>
                
                <div>
                    <h4>Banshee Mods</h4>
                    <ModsRotation vendor={'Banshee'}/>
                </div>
            </div> */}

            <div>
                <h4>Altars of Sorrow Reward</h4>
                <AltarsOfSorrow />
            </div>
            <div>
                <h4>Wellspring</h4>
                <Wellspring />
            </div>
            
            <div>
                {/* <h4>Strike Modifiers</h4> */}
                {/* <StrikeModifiers /> */}
            </div>
        </div>
    );
};

export default Daily;
